        mHdltvoutHandle << " , " <<  " \"conv_out_0_we0\" :  \"" << conv_out_0_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv_out_0_d0\" :  \"" << conv_out_0_d0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv_out_1_address0\" :  \"" << conv_out_1_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv_out_1_ce0\" :  \"" << conv_out_1_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv_out_1_we0\" :  \"" << conv_out_1_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"conv_out_1_d0\" :  \"" << conv_out_1_d0.read() << "\" ";
